    <TouchableTab onPress={() => setcardState(0)}> login </TouchableTab>
    <TouchableTab onPress={() => setcardState(1)}> Signin </TouchableTab>

    {cardstate == 0 ? ( <LoginComponent/> ) : ( <SignInComponent/> )}
  </Card>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
